drop table if exists gadetraer;
create table gadetraer (
	id INT, 
	FID VARCHAR(100), 
	dansk_navn VARCHAR(100), 
	traeart VARCHAR(100), 
	slaegt VARCHAR(100), 
	slaegtsnavn VARCHAR(100), 
	planteaar VARCHAR(100), 
	bydelsnavn VARCHAR(100), 
	wkb_geometry GEOMETRY NOT NULL SRID 4326,
	primary key(id)
);
